import styled from "styled-components";

const styledCard = styled.div`
  background-color: white;
  box-shadow: 0px 2px 8px rgba(0, 0, 0, 0.26);
  border-radius: 10px;
`;

const Card = (props) => {
  return <styledCard>{props.children}</styledCard>;
};

export default Card;
